window.bookSummaryJSON = "<p><b>They're my boys now - the four heirs of Delta. Together, we’re a team...a family.</b></p> <p>Five broken, brutal, possibly sociopathic people, and we are all that stands between the world and the powerful, corrupt Delta corporation.</p> <p>We have no idea what we’re doing, but somehow, we are determined to stop them. Permanently. We just need leverage...irrefutable evidence of their corruption. And we need it now. Before the vote that will change everything.</p> <p>Only, there are a few other issues to deal with first. Dante in prison for murder, blood coated roses showing up on my doorstep, and my bio mom reaching all new levels of insanity.&nbsp;</p> <p>For the first time, we might be completely out of our depth, but we won’t give up. Not until the final battle is played out. Not until the war has been won.</p> <p><b>Please note: </b>This dark contemporary romance features one girl and four sexy, dangerous boys but is not a reverse harem. Includes a sneak peek of chapter one of <i>Princess Ballot</i>.&nbsp;</p>"; 
